	add("blog", "{\"term\":\"blog\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by the Liverpool Science Fiction Society in 1955 at the Cytricon convention held in the George Hotel, Kettering, Northamptonshire. It was used as the fake sponsor of an audio play and fake advertisements were placed around the hotel; an actual drink was later served at the hotel bar after customers asked for it.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cocktail or punch served at science fiction conventions. Ingredients vary for different conventions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, Liverpool Science Fiction Society, advertisement hung by hotel bar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Drink \u0027\u0027Blog\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That doesn\u0027t explain why I haven\u0027t seen anyone objectionably drunk at Minicons over the past five or six years. There\u0027s generally kegs of three or more different and excellent micro-brewery beers in the consuite, along with \u0027\u0027Blog\u0027\u0027 (which is alcoholic by definition, when unmodified), and other alcoholic drinks are available at a dozen or more of the open room parties\", \"priority\":4}]}, \"synonyms\":{}}");

