	add("block", "{\"term\":\"block\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"old norse\", \"old dutch\"], \"text\":\"From Middle english (1100-1500) \u0027blok\u0027 (log, stump, solid piece) from Old french (842-ca. 1400) \u0027bloc\u0027 (log, block) from Middle dutch (ca. 1050-1350) \u0027blok\u0027 (treetrunk) from Old dutch {{m|odt|*blok||log}}, from Proto-germanic {{m|gem-pro|*blukką||beam, log}}, from Proto-indo-european {{m|ine-pro|*bhulg\u0027-}}, from {{m|ine-pro|*bhelg\u0027-||thick plank, beam, pile, prop}}. Cognate with Old Frisian \u0027blok\u0027 Old Saxon \u0027blok\u0027 Old high german (ca. 750-1050) \u0027bloh\u0027 \u0027bloc\u0027 (block) Old english (ca. 450-1100) \u0027bolca\u0027 (gangway of a ship, plank) Old norse \u0027bǫlkr\u0027 (divider, partition) More at {{l|en|balk}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A substantial, often approximately cuboid, piece of any substance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You young porkers who are sitting in front of me, every one of you will scream your lives out at the \u0027\u0027block\u0027\u0027 within a year\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027block\u0027\u0027 of ice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027block\u0027\u0027 of stone\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Anne Boleyn placed her head on the \u0027\u0027block\u0027\u0027 and awaited her execution\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A group of urban lots of property, several acres in extent, not crossed by public streets\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m going for a walk around the \u0027\u0027block\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A residential building consisting of flats\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dHe turned back to the scene before him and the enormous new \u0027\u0027block\u0027\u0027 of council dwellings. The design was some way after Corbusier but the \u0027\u0027block\u0027\u0027 was built up on plinths and resembled an Atlantic liner swimming diagonally across the site\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027block\u0027\u0027 of flats\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The distance from one street to another in a city that is built (approximately) to a grid pattern\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The place you are looking for is two long \u0027\u0027blocks\u0027\u0027 east and one short \u0027\u0027block\u0027\u0027 north\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The human head\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ll knock your \u0027\u0027block\u0027\u0027 off\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A wig block: a simplified head model upon which wigs are worn\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, \u0027\u0027, s:Moby-Dick/Chapter chapter 1\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Next morning, Monday, after disposing of the embalmed head to a barber, for a \u0027\u0027block\u0027\u0027, I settled my own and comrade’s bill; using, however, my comrade’s money\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A mould on which hats, bonnets, etc., are shaped\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"He wears his faith but as the fashion of his hat; it ever changes with the next \u0027\u0027block\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A set of sheets (of paper) joined together at one end\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027block\u0027\u0027 of 100 tickets\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A logical data storage unit containing one or more physical sectors (see cluster\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A region of code in a program that acts as a single unit, such as a function or loop\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A fixed-length group of bits making up part of a message\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"A case with one or more sheaves/pulleys, used with ropes to increase or redirect force, for example, as part of the rigging of a sailing ship\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A portion of a macromolecule, comprising many units, that has at least one feature not present in adjacent portions\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Something that prevents something from passing (see blockage\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s a \u0027\u0027block\u0027\u0027 in the pipe that means the water can\u0027t get through\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"An action to interfere with the movement of an opposing player or of the object of play (ball, puck\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A shot played by holding the bat vertically in the path of the ball, so that it loses momentum and drops to the ground\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"A defensive play by one or more players meant to deflect a spiked ball back to the hitter’s court\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"A joined group of four (or in some cases nine) postage stamps, forming a roughly square shape\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"A section of split logs used as fuel\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"solitary Solitary confinement\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"A cellblock\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"The perch on which a bird of prey is kept\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"A piece of hard wood on which a stereotype or electrotype plate is mounted\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"A blockhead; a stupid fellow; a dolt\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":40},{\"upperType\":\"NOUN\", \"text\":\"What a \u0027\u0027block\u0027\u0027 art thou\", \"priority\":41},{\"upperType\":\"NOUN\", \"text\":\"A section of a railroad where the block system is used\", \"priority\":42},{\"upperType\":\"NOUN\", \"text\":\"The position of a player or bat when guarding the wicket\", \"priority\":43},{\"upperType\":\"NOUN\", \"text\":\"A blockhole\", \"priority\":44},{\"upperType\":\"NOUN\", \"text\":\"The popping crease\", \"priority\":45}]}, \"synonyms\":{}}");

