	add("blogdom", "{\"term\":\"blogdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|blog|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The world or sphere of weblogs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Bruce Abramson, \u0027The secret circuit\u0027 (page 278\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All that had to happen was for the forces of IP \u0027\u0027blogdom\u0027\u0027 to march to Washington and demand IP reform. Why wasn\u0027t it happening? It wasn\u0027t happening because the blogosphere is only a small part of the story\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ms. Wilder-Taylor put up a post on her blog, Babyonbored, that has reverberated throughout mommy \u0027\u0027blogdom\", \"priority\":4}]}, \"synonyms\":{}}");

