	add("bloke", "{\"term\":\"bloke\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First known usage 1851. Origin unknown. Hypotheses include:\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?allowed_in_frame\u003d0\u0026amp;search\u003dbloke\u0026amp;searchmode\u003dnone \u0026quot;bloke\u0026quot;], Online Etymology Dictionary\u0026lt;/ref\u0026gt;* from Celtic \u0027ploc\u0027 (large, stubborn person)* from Roma or Hindi \u0027loke\u0027 (a man)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man, a fellow; an ordinary man, a man on the street\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, w:P. G. P. G. Wodehouse, \u0027w:Very Good, Very Good, Jeeves\u0027, 2006, Overlook Press, %22blokes%22+-intitle:%22bloke|blokes%22\u0026amp;dq\u003d%22bloke%22|%22blokes%22+-intitle:%22bloke|blokes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dM0XzTvT5AouOmQWzifm8Ag\u0026amp;redir_esc\u003dy page 235\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The door flew open, and there was a \u0027\u0027bloke\u0027\u0027 with spectacles on his face and all round the spectacles an expression of strained anguish. A \u0027\u0027bloke\u0027\u0027 with a secret sorrow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1931\u0027\u0027, w:Cab Cab Calloway, w:Irving Irving Mills, \u0027w:Minnie the Minnie the Moocher\u0027, [http://www.heptune.com/minnieth.html lyrics of 1930, 31 and 33 versions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She messed around with a \u0027\u0027bloke\u0027\u0027 named Smoky\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, w:Brendan Brendan Behan, \u0027w:Borstal Borstal Boy\u0027, %22blokes%22+-intitle:%22bloke|blokes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duDbzTqPNLITDmQW8r6GKAg\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"%22blokes%22%20-intitle%3A%22bloke|blokes%22\u0026amp;f\u003dfalse page 281\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It was a Cockney \u0027\u0027bloke\u0027\u0027 who had never seen a cow till he came inside. Cragg said it took some \u0027\u0027blokes\u0027\u0027 like that, and city fellows are the worse\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Elizabeth Young, \u0027Asking for Trouble\u0027, %22blokes%22+-intitle:%22bloke|blokes%22\u0026amp;dq\u003d%22bloke%22|%22blokes%22+-intitle:%22bloke|blokes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duDbzTqPNLITDmQW8r6GKAg\u0026amp;redir_esc\u003dy page 19\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"As her current \u0027\u0027bloke\u0027\u0027 was turning out better than expected, I didn\u0027t see much of her lately\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"a man who behaves in a particularly laddish or overtly heterosexual manner\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An anglophone man\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"An exemplar of a certain masculine, independent male archetype\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 May 5, Belinda Luscombe, “[http://www.time.com/time/magazine/article/0,9171,996881,00.html Cinema: Of Mad Max and Madder Maximus]”, \u0027Time\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"‘The \u0027\u0027Bloke\u0027\u0027’ is a certain kind of Australian or New Zealand male. The Classic \u0027\u0027Bloke\u0027\u0027 is not a voluble beast. His speech patterns are best described as infrequent but colorful. ¶ The \u0027\u0027Bloke\u0027\u0027 is pragmatic rather than classy. ¶ Most of all, the \u0027\u0027Bloke\u0027\u0027 does not whinge\", \"priority\":15}]}, \"synonyms\":{}}");

	add("blond", "{\"term\":\"blond\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Sanskrit\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027blond\u0027 {{g|m}}, from Old french (842-ca. 1400) \u0027blond\u0027 from Frankish {{m|frk|*blund||a mixed color between golden and light-brown}}, from Proto-germanic {{m|gem-pro|*blundaz||mixed, blinding}}, from Proto-indo-european {{m|ine-pro|*bʰlendʰ-||to become turbid, see badly, go blind}}. Compare Old english (ca. 450-1100) \u0027blondenfeax\u0027 Old english (ca. 450-1100) \u0027blandan\u0027 (to mix) More at {{l/en|blend}}.Alternative etymology connects Frankish {{m|frk|*blund}} to Proto-germanic {{m|gem-pro|*blundaz||blond}}, from Proto-indo-european {{m|ine-pro|*bʰl̥ndʰ-}}, {{m|ine-pro|*bʰlendʰ-||blond, red-haired}}. If so, then it would be cognate with Sanskrit \u0027ब्रध्न\u0027 (tr\u003dbradhná)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pale yellowish (golden brown) color, especially said of hair color\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person with this hair color\", \"priority\":2}]}, \"synonyms\":{}}");

	add("blood", "{\"term\":\"blood\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) {{m|enm|blood}}, from Old english (ca. 450-1100) {{m|ang|blōd}}, from Proto-germanic {{m|gem-pro|*blōþą}}, of uncertain origin. Cognate with Saterfriesisch {{m|stq|Bloud}}, West Frisian {{m|fy|bloed}}, Dutch {{m|nl|bloed}}, German {{m|de|Blut}}, Danish {{m|da|blod}}, Swedish {{m|sv|blod}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vital liquid flowing in the bodies of many types of animals that usually conveys nutrients and oxygen. In vertebrates, it is colored red by hemoglobin, is conveyed by arteries and veins, is pumped by the heart and is usually generated in bone marrow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dAn artificial kidney these days still means a refrigerator-sized dialysis machine. Such devices mimic the way real kidneys cleanse \u0027\u0027blood\u0027\u0027 and eject impurities and surplus water as urine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A family relationship due to birth, such as that between siblings; contrasted with relationships due to marriage or adoption. (\u0027See\u0027 blood relative, blood relation, by blood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1606-1687\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a friend of our own \u0027\u0027blood\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Sir (1771-1832\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"to share the \u0027\u0027blood\u0027\u0027 of Saxon royalt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A blood test or blood sample\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The sap or juice which flows in or from plants\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1841\u0027\u0027, Benjamin Parsons, \u0027[http://www.worldcat.org/oclc/65270457 Anti-Bacchus]\u0027, page 95\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It is no tautology to call the \u0027\u0027blood\u0027\u0027 of the grape red or purple, because the juice of that fruit was sometimes white and sometimes black or dark. The arterial blood of our bodies is red, but the venous is called \u0026quot;black blood.\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, Levi Leslie Lamborn, \u0027American Carnation Culture\u0027, fourth edition, page 57\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Disbudding is merely a species of pruning, and should be done as soon as the lateral buds begin to develop on the cane. It diverts the flow of the plant\u0027s \u0027\u0027blood\u0027\u0027 from many buds into one or a few, thus increasing the size of the flower\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1916\u0027\u0027, John Gordon Dorrance, \u0027The Story of the Forest\u0027, page 44\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Look at a leaf. On it are many little raised lines which reach out to all parts of the leaf and back to the stem and twig. These are \u0026quot;veins,\u0026quot; full of the tree\u0027s \u0027\u0027blood\u0027\u0027. It is white and looks very much like water\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The juice of anything, especially if red\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Bible, xiix. 1\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"He washedhis clothes in the \u0027\u0027blood\u0027\u0027 of grapes\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Temper of mind; disposition; state of the passions\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"when you perceive his \u0027\u0027blood\u0027\u0027 inclined to mirt\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A lively, showy man; a rake\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Seest thou nothow giddily \u0027a turns about all the hot \u0027\u0027bloods\u0027\u0027 between fourteen and five and thirty\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1811-1863\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"It was the morning costume of a dandy or \u0027\u0027blood\", \"priority\":26}]}, \"synonyms\":{}}");

