	add("bloodhound", "{\"term\":\"bloodhound\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027blodhound\u0027 \u0027blodhond\u0027 equivalent to {{compound|blood|hound|lang\u003den}}. Cognate with Dutch \u0027bloedhond\u0027 (bloodhound) Middle low german \u0027blōthunt\u0027 (bloodhound) German \u0027bluthund\u0027 (bloodhound) Danish \u0027blodhund\u0027 (bloodhound) Swedish \u0027blodhund\u0027 (bloodhound) The detective sense follows from the dog\u0027s ability to follow a trail.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large scenthound famed for its ability to follow a scent many days old, over vast distances. This dog is often used as a police dog to track missing people, fleeing suspects, or escaped prisoners\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A detective or other person skilled at finding people or clues\", \"priority\":2}]}, \"synonyms\":{}}");

