	add("bloodnut", "{\"term\":\"bloodnut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with red hair, a redhead\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, w:Tim Tim Winton, \u0027w:Dirt Dirt Music\u0027, %22bloodnuts%22+-intitle:%22bloodnut%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dhVP0Tq7bBc-JmQWehoCSAg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22bloodnuts%22%20-intitle%3A%22bloodnut%22\u0026amp;f\u003dfalse page 185\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He was a pugnacious \u0027\u0027bloodnut\u0027\u0027 with a droll wit and a rollup fag on his lip\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Bill Collopy, \u0027House of Given\u0027, %22bloodnuts%22+-intitle:%22bloodnut%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcFP0TqzZNI7ymAWP7JmuAg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22bloodnuts%22%20-intitle%3A%22bloodnut%22\u0026amp;f\u003dfalse page 13\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“Red” his mates called him: a wild \u0027\u0027bloodnut\u0027\u0027 like his father, and like his late uncles before Tobruk sands claimed them\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Christopher Kremmer, \u0027The Chase\u0027, %22bloodnuts%22+-intitle:%22bloodnut%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dhVP0Tq7bBc-JmQWehoCSAg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22bloodnuts%22%20-intitle%3A%22bloodnut%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He looked younger, thinner, was pale and unshaven, the image of a man on a bender, complete with a red-haired partner in crime\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"‘I say, Howard, your chief chemist would look ree-\u0027mahr\u0027-kable on a polo pony, don′t think?’ said the \u0027\u0027bloodnut\u0027\u0027, who reeked of alcohol and stale tobacco\", \"priority\":11}]}, \"synonyms\":{}}");

