	add("bloodwood", "{\"term\":\"bloodwood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|blood|wood|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various trees having red wood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Certain eucalypt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Tom Cole, \u0027Hell West and Crooked\u0027, Angus \u0026amp; Robertson 1995, p. 255\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I cut \u0027\u0027bloodwood\u0027\u0027 saplings and shaped a new pair of shafts with an adze\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"genus (formerly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"formerly\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A loblolly bay (tree\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a tree found in Central and South America\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any of several trees from the genus \u0027Pterocarpus\u0027, of the African and Asian tropics\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"a tree from Mexico\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The wood of such trees\", \"priority\":11}]}, \"synonyms\":{}}");

