	add("blossom", "{\"term\":\"blossom\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"{{PIE root|en|bʰleh₃}}Middle english (1100-1500) \u0027blosme\u0027 from Old english (ca. 450-1100) {{m|ang|blōstm}}, {{m|ang|blōstma}}, from Proto-germanic {{m|gem-pro|*blōstama}} (compare West Frisian \u0027blossem\u0027 Dutch \u0027bloesem\u0027 , enlargement of {{m|gem-pro|*blōstaz}} (compare German \u0027blust\u0027 , from Proto-indo-european {{m|ine-pro|*bʰleh₃-s-||bloom, flower}}, from {{m|ine-pro|*bʰleh₃-||to thrive, bloom}}. Cognate with Latin {{m|la|flōs||flower}}, {{m|la|Flōra||goddess of plants}}, Albanian \u0027bleron\u0027 (to blossom, thrive) More at {{m|en|blow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flower, especially indicative of fruit as seen on a fruit tree etc.; taken collectively as the mass of such flowers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027blossom\u0027\u0027 has come early this year\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state or season of producing such flowers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The orchard is in \u0027\u0027blossom\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A blooming period or stage of development; something lovely that gives rich promise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Massinge\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"in the \u0027\u0027blossom\u0027\u0027 of my yout\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The colour of a horse that has white hairs intermixed with sorrel and bay hairs\", \"priority\":8}]}, \"synonyms\":{}}");

