	add("blouse", "{\"term\":\"blouse\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"German\", \"English\", \"French\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"Occitan\"], \"text\":\"1828, from French \u0027blouse\u0027 (a workman\u0027s or peasant\u0027s smock) of obscure origin. Three theories include:* French \u0027blousse\u0027 (scraps of wool) from Occitan \u0027lano blouso\u0027 (pure or short wool) from \u0027blous\u0027 from Old high german (ca. 750-1050) \u0027blōz\u0027 () \u0026quot;naked, bare\u0026quot; (German \u0027bloss\u0027 \u0026quot;bare\u0026quot;)* A conflation of the aforementioned and French \u0027bliaud\u0027 from Old french (842-ca. 1400) \u0027bliau\u0027 from Frankish {{m|frk|*blīfald||topcoat of scarlet colour}}, from \u0027\u0027 (blī-) \u0026quot;coloured, bright\u0026quot; + \u0027\u0027 (-fald) More at blee, fold.* From \u0027pelusia\u0027 from w:Pelusium|Pelusium, a city of Lower Egypt, a clothing manufacturer during the Middle Ages.More at blee, fold.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outer garment, usually loose, that is similar to a shirt and reaches from the neck to the waist or below. Nowadays, in colloquial use, \u0027blouse\u0027 refers almost always to a woman\u0027s shirt that buttons down the front\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A loose-fitting uniform jacket\", \"priority\":2}]}, \"synonyms\":{}}");

