	add("blowhard", "{\"term\":\"blowhard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|blow|hard|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who talks too much or too loudly, especially in a boastful or self-important manner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, \u0026quot;[http://query.nytimes.com/mem/archive-free/pdf?_r\u003d1\u0026amp;res\u003d9806E5DF113FEE34BC4851DFB667838A679FDE Correspondence of the Missouri Democrat],\u0026quot; \u0027New York Times\u0027, 20 Oct., p. 2. (retrieved 24 Aug. 2009\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The merchants are the most ultra Secessionists. . . . Some men of Northern origin were the most rabid. A \u0026quot;\u0027\u0027blowhard\u0027\u0027,\u0026quot; named James Patterson, of Augusta, Jackson County, was originally from Pennsylvania. He stumped the county and was elected to the Convention, and cast his vote for secession\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027, w:Robert Barr Robert Barr, \u0026quot;The Shadow of the Greenback\u0026quot; in \u0027Revenge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"T]he loud-mouthed \u0027\u0027blowhard\u0027\u0027 seemed just the man to flinch when real danger confronted him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,795568,00.html POLITICAL NOTES: Republican Rift?],\u0026quot; \u0027Time\u0027, 17 Nov\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Oh, this bellowing, blatant, bellicose, belligerent, bombastic \u0027\u0027blowhard\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jo-Ellan Dimitrius and Wendy Mazzarella, \u0027Reading People\u0027, ISBN 9780345504135, [http://books.google.ca/books?id\u003dMhSwRVX4wNAC\u0026amp;pg\u003dRA1-PA137\u0026amp;dq\u003dblowhards+subject:%22psychology%22\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003db\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d2001\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d2009\u0026amp;as_brr\u003d3\u0026amp;client\u003dfirefox\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dblowhards%20subject%3A%22psychology%22\u0026amp;f\u003dfalse p. 137\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In my profession, I have seen more than my share of \u0027\u0027blowhards\u0027\u0027 who use volume to intimidate the weak, fool the feeble-minded, or control the insecure or lazy\", \"priority\":10}]}, \"synonyms\":{}}");

